import React from 'react';
import styled from 'styled-components';
import imageFooter from '../assets/image-footer.jpg';
import imageCover from '../assets/image-cover.jpg';

export default function Footer() {
  return (
    <>
      <imgFooter src={imageFooter} alt="최하단 이미지" />
      <Cover src={imageCover} alt="최상단 이미지" />
      <FooterText className="bold">상성 & 경민</FooterText>
      <FooterText>예쁘게 잘 살겠습니다 ♡</FooterText>
    </>
  );
}

export const imgFooter = styled.img`
  vertical-align: bottom;
  width: 100%;
`;

export const Cover = styled.img`
  vertical-align: bottom;
  width: 100%;
`;

export const FooterText = styled.p`
  font-size: 1rem;
  text-align: center;
  line-height: 2rem;
  &.bold {
    font-family: 'SunBatang-Medium';
  }
`;
